('2415','18','7929','Villa Samsel',Null,'Neu renovierte Villa in Paguera zu verkaufen','33919','Diese sehr schöne neu renovierte Villa steht am Ortsrand von Paguera nur wenige Gehminuten vom schönen Sandstrand entfernt. \r\nDiese exklusive Villa von ca. 800m2 Wohnfläche besticht durch das gekonnte Design. Empfangen wird man durch ein grosszügiges Entree, das Erdgeschoss teilt sich in Wohnzimmer von dem man einen herrlichen Blick auf Garten und Pool bekommt, sowie Gästezimmer mit WC/Bad ensuite, ebenso befindet sich die sehr praktische neue Bulthaupt Küche mit allem was man sich in einer modernen Kusche wünscht im  Erdgeschoss. Im Obergeschoss, das man bequem mit dem Aufzug erreichen kann, befinden sich 5 grosszügige Schlafzimmer 2 davon mit Bad/WC ensuite.\r\n\r\nDer Aussenbereich befinden sich schöne Terassen eine Aussenküche sowie ein schön angelegter Pool an dem man die Ruhe geniessen kann.\r\n\r\nEine Tiefgarage für 6 Autos sowie diverse Abstellräume bieten genug Platz für alles.\r\n','33920','2900000','106','2015-12-14 10:05:12','106','2015-12-14 10:06:55',Null,'2545','104','1195',1,'1','0',Null,Null,Null,'33921',Null,'0','0','0',Null,'2015-12-14 10:20:00',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33922',Null,'33923',Null,'33924',Null,'33925','büro','33926','0',0,'0');
